import styled from 'styled-components';

export const Gutter = styled.div`
	marin: 0 auto;
	.box-style {
		position: relative;
		padding: 0 5px 5px 24px;
	}
	.gutter-box1 {
		background: #70ca63;
	}
	.gutter-box2 {
		background: #e9573f;
	}
	.gutter-box3 {
		background: #3bafda;
	}
	.gutter-box4 {
		background: #967adc;
	}
	.icons {
		position: absolute;
		right: 0;
		top: 10px;
		line-height: 100px;
		font-size: 100px;
		opacity: 0.7;
		color: #fff;
	}
	.title {
		color: #f5f2fd;
		font-size: 24px;
		line-height: 24px;
		padding-top: 15px;
		margin-bottom: 5px; 
	}
	.text {
		color: #f5f2fd;
		font-size: 13px;
	}
	.bar-box {
		margin-top: 20px;
	}
`;
